hough his parent are both black eyed and have no family history of any other color.  What makes this boy even more interesting…\\n\\n#9 The Mind Reader\\n…  But this remarkable young girl from India can do much more than that.   Meet Nadana Unnikrishnan.  who was diagnosed with broad spectrum Autism when she was a baby but don’t let her fool you.  Nandana can read her Mother’s thoughts…\\n\\n#8 Brainy\\nWhen thinking of some of the most brilliant minds who have ever existed in the world, Albert Einstein comes to mind.  With his measured IQ of 160, few people can have such high score.  But that is not the case with this smart little boy from a city called la Ceja near Medellin, Colombia.  Miguel Ángel Rojas … \\n \\n#7 Artsy\\nYou may have been doodling since you were a little kid, but very few children have their art work displayed at any other place besides the family refrigerator.  Aelita Andre from Australia…\\n\\n#6 The Star Boy\\nThis Now 11 year old young man is a remarkable human being… well maybe not, about the human being part…, since he was a little boy, Boriska, a boy from Russia has shown signs of incredible learning abilities and was able to even speak when he was couple of months old.  He is so extraordinary that by the age of 1, he was reading newspapers.  His most interesting trade besides faster development is that the boy remembers his past lives, but not on earth. Boriska says that he was actually born in Mars …\\n\\n#5 The Healer\\n… But there are couple of emerging cases in Brazil and India where the business of healing is becoming a very popular tourist attraction.  An emerging popular healer in brazil is Eleni Santos.  \\n\\n#4 Super Girl\\nThis Russian young woman is Ana Belysh who by the age of ten, was already displaying her hulk like strength by doing 1500 push-ups in less than an hour in front of an audience and therefore earning her place at the Guinness Book of World Records…\\n\\n#3 Human Calculator\\nShakuntala Devi our superhuman was born in india with what we can say is a calculator in her brain.  Since a very young age, Shakuntala was able to do very complex math but her family was very poor and was unable to help her develop her talents…\\n\\n#2 X-Ray \\nContinuing with the fantastic super powers, here is another super girl, this superhuman is Natasha Demkina who is gifted with x-ray vision!!! Its not used as in the airports to detect guns. This young woman has patients, works with doctors and more…\\n\\n#1 The Real Super Heroes\\n\\nThe material credited in the link below was used, some with modifications, with rights provided per the publishing of said material under a CC-BY license. A material list and all attributions will be found there.\\n\\nhttps:\/\/drive.google.com\/open?id=1Puf7BCmmu22-UZ05lQQjGg6AIfYZUfxF\\n\\n#SuperPowers #AmazingKids #UndiscoveredWorlds\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/iMakJcNJMrc\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDQkk7if14RyDbrFFDF5jE4NhYbTg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/iMakJcNJMrc\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCFR1eQYGf-LS4kYB-QSnP8Ir8-3w\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/iMakJcNJMrc\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDngtRL2S3ISo6gctzu2izJltFzsQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/iMakJcNJMrc\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDRigE1E5cmdksbp2oFU6U4ok31rA\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/iMakJcNJMrc\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.6195579,\"allowRatings\":true,\"viewCount\":\"7391084\",\"author\":\"Undiscovered Worlds\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":fals DtQMdr39J4lZ_4TTw\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/iMakJcNJMrc\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/iMakJcNJMrc\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/iMakJcNJMrc?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/iMakJcNJMrc?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"11 CHILDREN with Amazing SUPERPOWERS!\"},\"description\":{\"simpleText\":\"11 CHILDREN with Amazing SUPERPOWERS!... A new Breed of humans is now being revealed.  Stan Lee may have predicted the future in his comic books and perhaps given us instructions on how to assist the new and real generation of X-Humans.  From mind readers to fire starters, here are the Children with amazing superpowers.  Lets hope we can all assist making these superheroes the good guys. \\n\\nTo Practice or Learn Spanish: Watch This Video Side By Side With Its Spanish Counterpart At Universos Abiertos: https:\/\/youtu.be\/On5dW27G2N4\\n\\nhttps:\/\/www.youtube.com\/c\/universosabiertos\\n\\n#11 The Fire Keeper\\n… Emma Tablate is a young girl who lives in a remote Western village in the Philippines.  Everywhere she went, fires would break out. The town people were starting to think that she was a pyromaniac …\\n\\n#10 Night Eye \\nIn another remote village, this time in china, there is a young boy named Nong Youhui who was born with blue eyes that look green in daylight, so far, not an issue even though his parent are both black eyed and have no family history of any other color.  What makes this boy even more interesting…\\n\\n#9 The Mind Reader\\n…  But this remarkable young girl from India can do much more than that.   Meet Nadana Unnikrishnan.  who was diagnosed with broad spectrum Autism when she was a baby but don’t let her fool you.  Nandana can read her Mother’s thoughts…\\n\\n#8 Brainy\\nWhen thinking of some of the most brilliant minds who have ever existed in the world, Albert Einstein comes to mind.  With his measured IQ of 160, few people can have such high score.  But that is not the case with this smart little boy from a city called la Ceja near Medellin, Colombia.  Miguel Ángel Rojas … \\n \\n#7 Artsy\\nYou may have been doodling since you were a little kid, but very few children have their art work displayed at any other place besides the family refrigerator.  Aelita Andre from Australia…\\n\\n#6 The Star Boy\\nThis Now 11 year old young man is a remarkable human being… well maybe not, about the human being part…, since he was a little boy, Boriska, a boy from Russia has shown signs of incredible learning abilities and was able to even speak when he was couple of months old.  He is so extraordinary that by the age of 1, he was reading newspapers.  His most interesting trade besides faster development is that the boy remembers his past lives, but not on earth. Boriska says that he was actually born in Mars …\\n\\n#5 The Healer\\n… But there are couple of emerging cases in Brazil and India where the business of healing is becoming a very popular tourist attraction.  An emerging popular healer in brazil is Eleni Santos.  \\n\\n#4 Super Girl\\nThis Russian young woman is Ana Belysh who by the age of ten, was already displaying her hulk like strength by doing 1500 push-ups in less than an hour in front of an audience and therefore earning her place at the Guinness Book of World Records…\\n\\n#3 Human Calculator\\nShakuntala Devi our superhuman was born in india with what we can say is a calculator in her brain.  Since a very young age, Shakuntala was able to do very complex math but her family was very poor and was unable to help her develop her talents…\\n\\n#2 X-Ray \\nContinuing with the fantastic super powers, here is another super girl, this superhuman is Natasha Demkina who is gifted with x-ray vision!!! Its not used as in the airports to detect guns. This young woman has patients, works with doctors and more…\\n\\n#1 The Real Super Heroes\\n\\nThe material credited in the link below was used, some with modifications, with rights provided per the publishing of said material under a CC-BY license. A material list and all attributions will be found there.\\n\\nhttps:\/\/drive.google.com\/open?id=1Puf7BCmmu22-UZ05lQQjGg6AIfYZUfxF\\n\\n#SuperPowers #AmazingKids #UndiscoveredWorlds\"},\"lengthSeconds\":\"657\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCmsdHB3smA6GyhkqFuCj3Dw\",\"externalChannelId\":\"UCmsdHB3smA6GyhkqFuCj3Dw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\" ffffffff-no-rj-mo","width":88,"height":88},{"url":"https://yt3.ggpht.com/a/AATXAJx0nOGbxJwhdlHCo_9ashn3kpv_g7o4mO-p4w=s176-c-k-c0xffffffff-no-rj-mo","width":176,"height":176}]},"title":{"runs":[{"text":"Undiscovered Worlds","navigationEndpoint":{"clickTrackingParams":"CJgBEOE5IhMIhIaMvIuT6gIVzLDeCh2rLw0S","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCmsdHB3smA6GyhkqFuCj3Dw","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCmsdHB3smA6GyhkqFuCj3Dw"}}}]},"subscriptionButton":{"type":"FREE"},"navigationEndpoint":{"clickTrackingParams":"CJgBEOE5IhMIhIaMvIuT6gIVzLDeCh2rLw0S","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCmsdHB3smA6GyhkqFuCj3Dw","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCmsdHB3smA6GyhkqFuCj3Dw","canonicalBaseUrl":"/channel/UCmsdHB3smA6GyhkqFuCj3Dw"}},"subscriberCountText":{"runs":[{"text":"58.5K subscribers"}]},"trackingParams":"CJgBEOE5IhMIhIaMvIuT6gIVzLDeCh2rLw0S"}},"description":{"runs":[{"text":"11 CHILDREN with Amazing SUPERPOWERS!... A new Breed of humans is now being revealed.  Stan Lee may have predicted the future in his comic books and perhaps given us instructions on how to assist the new and real generation of X-Humans.  From mind readers to fire starters, here are the Children with amazing superpowers.  Lets hope we can all assist making these superheroes the good guys. \n\nTo Practice or Learn Spanish: Watch This Video Side By Side With Its Spanish Counterpart At Universos Abiertos: "},{"text":"https://youtu.be/On5dW27G2N4","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIhIaMvIuT6gIVzLDeCh2rLw0S","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=On5dW27G2N4","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"On5dW27G2N4"}}},{"text":"\n\n"},{"text":"https://www.youtube.com/c/universosab...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIhIaMvIuT6gIVzLDeCh2rLw0SSLflpJrchKnjiAE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/c/universosabiertos","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/c/universosabiertos","nofollow":true}}},{"text":"\n\n#11 The Fire Keeper\n… Emma Tablate is a young girl who lives in a remote Western village in the Philippines.  Everywhere she went, fires would break out. The town people were starting to think that she was a pyromaniac …\n\n#10 Night Eye \nIn another remote village, this time in china, there is a young boy named Nong Youhui who was born with blue eyes that look green in daylight, so far, not an issue even though his parent are both black eyed and have no family history of any other color.  What makes this boy even more interesting…\n\n#9 The Mind Reader\n…  But this remarkable young girl from India can do much more than that.   Meet Nadana Unnikrishnan.  who was diagnosed with broad spectrum Autism when she was a baby but don’t let her fool you.  Nandana can read her Mother’s thoughts…\n\n#8 Brainy\nWhen thinking of some of the most brilliant minds who have ever existed in the world, Albert Einstein comes to mind.  With his measured IQ of 160, few people can have such high score.  But that is not the case with this smart little boy from a city called la Ceja near Medellin, Colombia.  Miguel Ángel Rojas … \n \n#7 Artsy\nYou may have been doodling since you were a little kid, but very few children have their art work displayed at any other place besides the family refrigerator.  Aelita Andre from Australia…\n\n#6 The Star Boy\nThis Now 11 year old young man is a remarkable human being… well maybe not, about the human being part…, since he was a little boy, Boriska, a boy from Russia has shown signs of incredible learning abilities and was able to even speak when he was couple of months old.  He is so extraordinary that by the age of 1, he was reading newspapers.  His most interesting trade besides faster development is that the boy remembers his past lives, but not on earth. Boriska says that he was actually born in Mars …\n\n#5 The Healer\n… But there are couple of emerging cases in Brazil and India where the business of healing is becoming a very popular tourist attraction.  An emerging popular healer in brazil is Eleni Santos.  \n\n#4 Super Girl\nThis Russian young woman is Ana Belysh who by the age of ten, was already displaying her hulk like strength by doing 1500 push-ups in less than an hour in front of an audience and therefore earning her place at the Guinness Book of World Records…\n\n#3 Human Calculator\nShakuntala Devi our superhuman was born in india with what we can say is a calculator in her brain.  Since a very young age, Shakuntala was able to do very complex math but her family was very poor and was unable to help her develop her talents…\n\n#2 X-Ray \nContinuing with the fantastic super powers, here is another super girl, this superhuman is Natasha Demkina who is gifted with x-ray vision!!! Its not used as in the airports to detect guns. This young woman has patients, works with doctors and more…\n\n#1 The Real Super Heroes\n\nThe material credited in the link below was used, some with modifications, with rights provided per the publishing of said material under a CC-BY license. A material list and all attributions will be found there.\n\n"},{"text":"https://drive.google.com/open?id=1Puf...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIhIaMvIuT6gIVzLDeCh2rLw0SSLflpJrchKnjiAE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=2mI2njFJ4Twtv24gY0lF9It8NF18MTU5MjgzNTE1MUAxNTkyNzQ4NzUx\u0026v=iMakJcNJMrc\u0026q=https%3A%2F%2Fdrive.google.com%2Fopen%3Fid%3D1Puf7BCmmu22-UZ05lQQjGg6AIfYZUfxF\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=2mI2njFJ4Twtv24gY0lF9It8NF18MTU5MjgzNTE1MUAxNTkyNzQ4NzUx\u0026v=iMakJcNJMrc\u0026q=https%3A%2F%2Fdrive.google.com%2Fopen%3Fid%3D1Puf7BCmmu22-UZ05lQQjGg6AIfYZUfxF\u0026event=video_description","target": ly history of any other color.  What makes this boy even more interesting…\n\n#9 The Mind Reader\n…  But this remarkable young girl from India can do much more than that.   Meet Nadana Unnikrishnan.  who was diagnosed with broad spectrum Autism when she was a baby but don’t let her fool you.  Nandana can read her Mother’s thoughts…\n\n#8 Brainy\nWhen thinking of some of the most brilliant minds who have ever existed in the world, Albert Einstein comes to mind.  With his measured IQ of 160, few people can have such high score.  But that is not the case with this smart little boy from a city called la Ceja near Medellin, Colombia.  Miguel Ángel Rojas … \n \n#7 Artsy\nYou may have been doodling since you were a little kid, but very few children have their art work displayed at any other place besides the family refrigerator.  Aelita Andre from Australia…\n\n#6 The Star Boy\nThis Now 11 year old young man is a remarkable human being… well maybe not, about the human being part…, since he was a little boy, Boriska, a boy from Russia has shown signs of incredible learning abilities and was able to even speak when he was couple of months old.  He is so extraordinary that by the age of 1, he was reading newspapers.  His most interesting trade besides faster development is that the boy remembers his past lives, but not on earth. Boriska says that he was actually born in Mars …\n\n#5 The Healer\n… But there are couple of emerging cases in Brazil and India where the business of healing is becoming a very popular tourist attraction.  An emerging popular healer in brazil is Eleni Santos.  \n\n#4 Super Girl\nThis Russian young woman is Ana Belysh who by the age of ten, was already displaying her hulk like strength by doing 1500 push-ups in less than an hour in front of an audience and therefore earning her place at the Guinness Book of World Records…\n\n#3 Human Calculator\nShakuntala Devi our superhuman was born in india with what we can say is a calculator in her brain.  Since a very young age, Shakuntala was able to do very complex math but her family was very poor and was unable to help her develop her talents…\n\n#2 X-Ray \nContinuing with the fantastic super powers, here is another super girl, this superhuman is Natasha Demkina who is gifted with x-ray vision!!! Its not used as in the airports to detect guns. This young woman has patients, works with doctors and more…\n\n#1 The Real Super Heroes\n\nThe material credited in the link below was used, some with modifications, with rights provided per the publishing of said material under a CC-BY license. A material list and all attributions will be found there.\n\nhttps://drive.google.com/open?id=1Puf7BCmmu22-UZ05lQQjGg6AIfYZUfxF\n\n#SuperPowers #AmazingKids #UndiscoveredWorlds","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/iMakJcNJMrc/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDQkk7if14RyDbrFFDF5jE4NhYbTg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/iMakJcNJMrc/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCFR1eQYGf-LS4kYB-QSnP8Ir8-3w","width":196,"height":110},{"url":"https://i.ytimg.com/vi/iMakJcNJMrc/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDngtRL2S3ISo6gctzu2izJltFzsQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/iMakJcNJMrc/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDRigE1E5cmdksbp2oFU6U4ok31rA","width":336,"height":188},{"url":"https://i.ytimg.com/vi/iMakJcNJMrc/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.6195579,"allowRatings":true,"viewCount":"7391084","author":"Undiscovered Worlds","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"45000","endTimeMs":"636000","watermark":{"thumbnails":[{"url":"https://i.y           var pageData = window.getPageData();
          window.loadDataHook(pageData.endpoint, pageData.data);
          window.loadDataHook = null;
        }
        setFiller();

    })();
  </script>
